Here is a contract based on the requirements you provided:

```Solidity
pragma solidity 0.6.12;

contract BountyContract {
    address public owner;
    uint256[] public numbounties;
    mapping(uint256 => uint256[]) public numfulfillments;
    mapping(uint256 => uint256) private balanceOf1;
    mapping(uint256 => address) public bountytoken;

    constructor() public {
        owner = msg.sender;
    }

    function extendDeadline(uint256 _index, uint256 _newDeadline) public {
        require(_index < numbounties.length,"Invalid index");
        require(_newDeadline > numbounties[6*_index],"New deadline must be greater than current");
        numbounties[6*_index] = _newDeadline;
    }

    function killBounty(uint256 _index) public {
        require(_index < numbounties.length,"Invalid index");
        numbounties[6*_index] = 0;
        msg.sender.transfer(numbounties[6*_index]);
        bountytoken[_index].call(abi.encodeWithSignature("transfer(address,uint256)", numbounties[6*_index], numbounties[6*_index]));
    }

    function transferIssuer(uint256 _index, address _newIssuer) public {
        require(_index < numbounties.length,"Invalid index");
        numbounties[6*_index] = uint256(_newIssuer);
    }

    function changeBountyFulfillmentAmount(uint256 _index, uint256 _newAmount) public {
        require(_index < numbounties.length,"Invalid index");
        require(numbounties[6*_index] <= 2 && numbounties[6*_index] == 0,"Invalid condition");
        numbounties[6*_index] = _newAmount;
    }

    function updateFulfillment(uint256 _index, uint256 _subIndex, string memory _data) public {
        require(_index < numbounties.length,"Invalid index");
        require(_subIndex < numfulfillments[_index].length,"Invalid sub-index");
        require(numfulfillments[2*_subIndex][0] == 0,"Invalid condition");
        if (bytes(_data).length <= 31) {
            numfulfillments[2*_subIndex][0] = keccak256(abi.encodePacked(bytes(_data)));
        } else {
            numfulfillments[2*_subIndex][0] = uint256(_data);
        }
    }

    function increasePayout(uint256 _index, uint256 _newAmount, uint256 _transferAmount) public payable {
        require(_index < numbounties.length,"Invalid index");
        require(_newAmount > numbounties[6*_index] && numbounties[6*_index] > 0 && msg.value == 0,"Invalid condition");
        (bool success, bytes memory data) = bountytoken[_index].call(abi.encodeWithSignature("balanceOf(address)", address(this)));
        require(success,"balanceOf call failed");
        uint256 balance = abi.decode(data, (uint256));
        if (balance - balanceOf1[_index] == _transferAmount && numbounties[6*_index] >= _newAmount) {
            numbounties[6*_index] = _newAmount;
        }
        if (_transferAmount != 0){
            bountytoken[_index].call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), _transferAmount));
        }
    }
}
```

